sap.fe.macros.description:
OData Version 4 Macros (XMLPreprocessor Plugins) for UI5 XML Views

<b> All the macros below are not controls. They will only create XML snippets during XMLPreprocessing. That generated XML will only use real controls. </b>

<h3>Prerequisites for using macros</h3> <ul> <li>The {@link sap.ui.core.util.XMLPreprocessor} must be used for view creation </li> <li>The view or fragment that uses the macros must define an xml namespace and require this macro library using template:require. E.g.: <pre>
&lt;mvc:View xmlns="sap.m"
	  xmlns:macro="sap.fe.macros"
	  template:require="{
	    macroLibrary: 'sap/fe/macros/macroLibrary'
	  }"
/&gt;
 </pre> </li> </ul>

